import React from 'react';
import './css/input.css';
import Banner from './Banner';

function About() {
    return (
    <div className="bg-[#ffffff] dark:bg-gray-800 w-screen h-screen overflow-hidden">
        <Banner/>
        {/* Tabs Navigation */}
            <div className="tabs bg-gray-200 dark:bg-gray-700 p-4">
                <ul className="flex justify-around">
                    <li
                        className={`cursor-pointer ${activeTab === "Restaurant" ? "font-bold" : ""}`}
                        onClick={() => setActiveTab("Restaurant")}
                    >
                        Restaurant
                    </li>
                    <li
                        className={`cursor-pointer ${activeTab === "Stores" ? "font-bold" : ""}`}
                        onClick={() => setActiveTab("Stores")}
                    >
                        Stores
                    </li>
                    <li
                        className={`cursor-pointer ${activeTab === "Activities" ? "font-bold" : ""}`}
                        onClick={() => setActiveTab("Activities")}
                    >
                        Activities
                    </li>
                    <li
                        className={`cursor-pointer ${activeTab === "Clubs" ? "font-bold" : ""}`}
                        onClick={() => setActiveTab("Clubs")}
                    >
                        Clubs
                    </li>
                </ul>
            </div>

            {/* Tab Content */}
            <div className="p-4 text-black dark:text-white">
                {renderContent()}
            </div>
        </div>
    );
}
export default About;
